!function(){const a=JSON.parse(cardsData),d=document.querySelector(".portfolio__cards");console.log(d),a.forEach((a=>{d.insertAdjacentHTML("beforeend",`\n            <div class="card" data-id=${a.id}>\n                <a href="#!" data-fancybox data-src="#modalWindow">\n                    <div class="card__img-wrapper">\n                        <div class=" card__img">\n                            <img src="${a.img}" width="216" alt="">\n                        </div>\n                    </div>\n                    <div class="card__decs">\n                        <div class="card__header" >\n                            <h3 class="title-3" data-header="header">${a.title}</h3>\n                        </div>\n                        <div class="card__text">\n                            <p class="text">${a.info}\n                            </p>\n                        </div>\n                        <div class="card__skils">\n                            ${a.skils}\n                        </div>\n                    </div>\n                </a>\n            </div> \n        `)})),Fancybox.bind("[data-fancybox]",{})}();